import React from "react";
import { Switch, Route } from "react-router-dom";
import Cart from "./Cart";

const CartPage = () => {

    return(
        <Switch>
            <Route path="/cart" componen={Cart}></Route>
        </Switch>
    )
}

export default CartPage;
